var util          = require("util");
var RequestHeader = require("../request");

function IfModifiedSinceHeader(value) {
    RequestHeader.call(this, value);
}

util.inherits(IfModifiedSinceHeader, RequestHeader);

IfModifiedSinceHeader.prototype.getKey = function() {
    return "If-Modified-Since";
};

module.exports = IfModifiedSinceHeader;
